  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:27.603783\",\n\t\"name\": \"nationwide-abnormal-amphibian-monitoring-project-region-3-interim-report-2003\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In 2000, the FWS's Environmental Contaminants
  Program (currently Environmental Quality Program) received funding as part of the
  Department of Interior's Amphibian Initiative. The surveys originally done in Regions
  3 and 5 (1997) were refined and expanded into a nationwide survey of over 43 refuges
  in 31 states. The six original locations in Region 3 included Mark Twain NWR - Annada
  District (renamed Clarence Cannon NWR) (MO), Mark Twain NWR - Brussels District
  (renamed Two Rivers NWR) (EL), Union Slough NWR (IA), Ottawa NWR (OH), Rydell NWR
  (MN), and Fergus Falls WMD (MN). More than 1,600 frogs were collected and examined.
  Ninety-eight percent of these frogs were Ranids with northern and southern leopard
  frogs accounting for the majority.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
